import React from "react";
// import "./"

function TableHead(props) {

    return (
        <table className="table">
            <thead>
            <tr>
            <th scope="col">Photo:</th>
            <th scope="col">Name:</th>
            <th scope="col">Phone:</th>
            <th scope="col">Email:</th>
            <th scope="col">DOB:</th>
            </tr>
        </thead>
      </table>
    )
}

export default TableHead;
